package operator1;

public class Switch {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int num=34;
		switch(num) {
		case 2:System.out.println("34");
		break;
		case 34:System.out.println("55");
		break;
		case 13:System.out.println("30");
		break;
		case 55:System.out.println("41");
		break;
		default:System.out.println("number is not there");
		}

	}

}
